function [c,H] = generateGmatrix(mes,n)
k = size(mes,2);
disp('   Chon phuong phap ma tran thuc hien');
disp('      1. Gallager regular Method ');
disp('      2. Nhap ma tran H ');
disp('      3. Ma tan H deu ngau nhien: ');
disp('      4. Wimax ');
while(1)
option = input('      Phuong phap: ');
switch option
    case 1
         break;
    case 2
         break;
    case 3
         break;
    case 4
         break;
    otherwise
         fprintf('\b');
         disp(' ---> NHAP SAI, NHAP LAI');
end
end
%--------------------------------------------------
if (option == 1)
    wc = input('      Nhap trong so cot:  wc = ');
    while(1)
    wr = input('      Nhap trong so hang: wr = ');
    if (rem(n,wr) ~= 0)
        fprintf('\b');
        disp(' ---> NHAP SAI, NHAP LAI');
    else
        break;
    end
    end
end
%--------------------------------------------------
if (option ==1)
    H1 = zeros([n/wr n]);
    for i= 1:(n/wr)
        for j=1:wr
            H1(i,(i-1)*wr+j) = 1;
        end
    end
    H=H1;
    for i=1:wc-1
        H2 = H1(:,randperm(n));
        H  = [H;H2];
    end
    temp=H;
end
%--------------------------------------------------
if (option == 2)
    B = input('      Nhap ma tran H: H = ');
    
    row=[];
    HW=[];
    for i=1:((n-size(mes,2))/96)
    for j = 1: n/96
        if (B(i,j) == -1)
            row = [row zeros(96)];
        else
            row = [row circshift(eye(96),B(i,j))];
        end
    end 
    HW=[HW;row];
    row =[];
end
    H = HW;
    
    temp=H;
end
